import React from 'react';
import PropTypes from 'prop-types';
import { Panel, Group, Div, PanelHeader } from '@vkontakte/vkui';
import users from './users.json'


const Home = ({ share, id, go, fetchedUser  }) => (
	<Panel id={id}>
		<PanelHeader>Ge</PanelHeader>
		<h2>GEGE</h2>
		<div className="container">
			<Div align="center" style={{ height: "315px"}}>
				<img className="clicked" src={require('../img/click.png')} onClick={add1} width={250} height={250} />
			</Div>
		</div>
	</Panel>
);

Home.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	share: PropTypes.func,
	fetchedUser: PropTypes.shape({
		photo_200: PropTypes.string,
		first_name: PropTypes.string,
		last_name: PropTypes.string,
		city: PropTypes.shape({
			title: PropTypes.string,
		}),
	}),
};

export default Home;
